import classes from "./../../css/Users.module.css";
import UserContainer from "./UserContainer";

const AllUsers = () => {
	return (
		<>
			<div className={classes.usersBox}>
				<h2>Список пользователей</h2>
			</div>
			<UserContainer />
		</>
	)
}

export default AllUsers;
